import "./App.css";
import React from "react";

import {
  Screen,
  Modal,
  ModalTitle,
  ModalSubtitle,
  ModalCenter,
  ModalFooter,
  ModalSubmitButton,
} from "./standards/styledDivs.js";

function App() {
  return (
    <Screen>
      <Modal>
        <ModalTitle>Welcome to Adopt-A-Pet</ModalTitle>
        <ModalSubtitle>Login</ModalSubtitle>
        <ModalCenter></ModalCenter>
        <ModalFooter>
          <ModalSubmitButton>Sign In</ModalSubmitButton>
        </ModalFooter>
      </Modal>
    </Screen>
  );
}

export default App;
